import "./App.css";
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Home from "./pages/Home";
import NavBarTop from "./components/navBarTop";

function App() {
  return (
    <Router>
      <NavBarTop />
      <Switch>
        <Route path="/" exact Component={Home} />
      </Switch>
    </Router>
    // <div className="App">
    //   <Home />
    // </div>
  );
}

export default App;
